    public static String decrypt(String str, String key){
        try {
            // RAS私钥解密
            byte[] valueDecode = AESEncodeUtil.base64Decode(str);
            byte[] encodedData = null;
            encodedData = RSAUtils.decryptByPrivateKey(valueDecode, key);
            byte[] aa = AESEncodeUtil.base64Decode(new String(encodedData, Charset.forName("UTF-8")));
            str = new String(aa,Charset.forName("UTF-8"));
        } catch (Exception e) {
            //throw new IOException("无法解密！");
        }
        return str;
    }

